const NavBar = () => (
  <div className="flex flex-col gap-5 not-fancy-font text-white navbar_fullsize ml-8 text-25 mt-10">
    <div>Home</div>
    <div>About me</div>
    <div>Projects</div>
    <div>Contact</div>
  </div>
);

export default NavBar;
